INSERT INTO `beranda_item` (`beranda_id`, `title`, `desc`, `text_content`, `text_content2`, `path`, `tanggal`, `user_id`) VALUES
(1, 'Selamat Datang di newKube', 'newKube merupakan shuffle audio player terkecil dengan fitur terlengkap, suara mega bass, hadir di Indonesia khusus melengkapi ', '						<p class="content_welcome">\n							<!-- this is what ?? -->\n							dunia gaya dan hiburan dalam bentuk MP3 untuk semua usia terutama remaja. Tampil dengan pilihan warna yang menarik dan dapat disesuaikan dengan selera pengguna MP3 di tanah air, yaitu warna putih, hitam, merah dan pink. Didesain khusus untuk kemudahan dan kenyamanan bagi pecinta musik dalam melakukan berbagai aktifitas seperti berolahraga, dalam perjalanan ke kampus atau tempat kerja. Selain itu, newKube mudah ditaruh di dalam tas bahkan di kantong baju.							<!-- this is what ?? -->\n						</p>', '<p class="tab_content">\n										Bluetree mempersembahkan merek terbaru dari Kube, dengan nama newKube. 																				Yang merupakan generasi kedua dari seri TheKube. 																				newKube dapat membaca kartu microSD dengan ukuran mulai dari 512MB hingga 32GB yang dapat menyimpan lagu favorit kamu sampai 8000 lagu dengan format audio MP3, WMA, MIDI, dan WAV.\n									</p>\n									<p class="tab_content">\n										newKube memiliki berat 18 gram dengan suara audio yang sangat luar biasa bagi pecinta musik. 																				Ditambah dengan kemudahan mentransfer lagu, hanya dengan menghubungkan kabel pengisian langsung ke newKube. 																				Kamu dapat menikmati musik kesukaan hingga enam jam, hanya dengan mengecas selama 2 jam saja. \n									</p>																		<span class="easy">Begitu mudah bukan?</span>', 'data/1303949035.png', '2013-01-08 15:30:28', 4);
